const ZillaSlab300 = `@font-face { font-family: 'Zilla Slab'; font-style: normal; font-weight: 300; src: local('Zilla Slab Light'), local('ZillaSlab-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const ZillaSlab300italic = `@font-face { font-family: 'Zilla Slab'; font-style: italic; font-weight: 300; src: local('Zilla Slab Light Italic'), local('ZillaSlab-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
